import React, { Component } from 'react';

class About extends Component {
  render() {

    return (
      <section id="About Game">
      <div className="row">

         <div className="nine columns main-col">
            <h2>About Our Game</h2>
            <h2>We are UCSC undergrade student, and WhereMyHeart is our final year project.</h2>
            <p>insert some image and a group photo over here</p>
         </div>
      </div>

   </section>
    )
  }
}

export default About;
